Plot: Inkubus tells the story of a skeleton crew working the final shift at a soon to be demolished police station. The night takes a gruesome turn when the demon, Inkubus, calmly walks into the station holding the severed head of a murdered girl. Inkubus toys with the crew, allowing himself to be restrained, and begins to proudly confess to his litany of crimes, some dating back to the Middle Ages. Why? Inkubus has a score to settle with the one detective that almost put him away some thirteen years ago. To their dismay, the cops quickly become pawns in InkubusÃ¢â‚¬â„¢ brutal crowning achievement of murder, gore, and mayhem. They ultimately realize itÃ¢â‚¬â„¢s his world, they only die in it.
